import { BrowserRouter as Router } from "react-router-dom";
import Route from "react-router-dom/Route";
import React from "react";
import Home from "./home/App";
import SignInSide from "./registeration/Login";
import Signup from "./registeration/signup";
import Loginpage from "./afterlogin/Loginadmin";
import Filters from "./afterlogin/Filters";
import Cardgrid from "./afterlogin/Cardsgrid";
import { Card } from "@material-ui/core";
import Forgot from "./registeration/Forgotpassword";

const Roouter = () => {
  return (
    <Router>
      <div>
        <Route
          path="/"
          exact
          render={() => {
            return (
              <div>
                {/* <Homecontent /> */}
                <Home />
              </div>
            );
          }}
        />
        <Route
          path="/about"
          exact
          render={() => {
            return (
              <div>
                <h1>my name is rishabh </h1>
              </div>
            );
          }}
        />

        <Route
          path="/login"
          exact
          render={() => {
            return (
              <div>
                <SignInSide />
              </div>
            );
          }}
        />

        <Route
          path="/signup"
          exact
          render={() => {
            return (
              <div>
                <Signup />
              </div>
            );
          }}
        />

        <Route
          path="/loginpage"
          exact
          render={() => {
            return (
              <div>
                {/* <Loginpage />
                <Filters /> */}
                <Cardgrid />
              </div>
            );
          }}
        />
        <Route
          path="/forgot"
          exact
          render={() => {
            return (
              <div>
                {console.log("rishabh jain")}
                <Forgot />
              </div>
            );
          }}
        />
      </div>
    </Router>
  );
};

export default Roouter;
